import React, { Component } from 'react'

export class intervalCountCounter extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         count: 0
      }
    }
    

  render() {
    return <h1>{this.state.count}</h1>
  }
}

export default intervalCountCounter
